    def bfs(source, target):
        bfs = [source]
        seen = {tuple(source)}
        for (x0, y0) in bfs:
            for (i, j) in [[0, 1], [1, 0], [-1, 0], [0, -1]]:
                (x, y) = (x0 + i, y0 + j)
